import React from 'react';

const About = () => {
  return (
    <section id="about" className="about">
      <h2>About Me</h2>
      <p>
        I am a driven and multilingual software engineering professional with experience in full-stack development,
        cloud technologies (AWS), and Agile methodologies. I have a passion for building efficient, secure, and
        user-friendly applications.
      </p>
    </section>
  );
};

export default About;
